CREATE DATABASE [ExpressFormsExample];
GO

USE ExpressFormsExample;
GO

drop table dbo.Engineer;
CREATE TABLE dbo.Engineer
(
	Id INT IDENTITY(0,1) PRIMARY KEY,
	Name VARCHAR(100),
	Location VARCHAR(100),
	Available BIT NOT NULL,
	FavoriteLanguage VARCHAR(100),
	CodeSnippet VARCHAR(MAX)
);		


drop table dbo.NameAndCity;
create table dbo.NameAndCity
(
	Id INT Identity(1,1) PRIMARY KEY,
	[First Name] VARCHAR(MAX),
	[Middle Name] VARCHAR(MAX),
	[Last Name] VARCHAR(MAX),
	City VARCHAR(100)
)

;